        function findPlotRoot(container) {
            if (!container) return null;

            if (!container || !window.Plotly) return;
            var plotRoot = findPlotRoot(container) || container;
            if (!plotRoot) return;

            catch (err) { console.warn('Plotly resize failed', err); }
        }

        function safeResizeActivePlot() {
            if (!window.Plotly) return;
            try {

                    .filter(function(c){
                        if (c.classList.contains('active')) return true;

        // Normalize / tweak figure prior to plotting
        function normalizeFig(fig, container) {
            var data = Array.isArray(fig && fig.data) ? JSON.parse(JSON.stringify(fig.data)) : (Array.isArray(fig) ? JSON.parse(JSON.stringify(fig)) : []);
            // pie tweaks
            data = data.map(function(t){
                if (!t) return t;
                var copy = JSON.parse(JSON.stringify(t));
                if (copy.type === 'pie' || copy['type'] === 'pie') {
                    if (!copy.textposition) copy.textposition = 'outside';
                    if (!copy.insidetextorientation) copy.insidetextorientation = 'radial';
                }
                return copy;
            });
            var layout = Object.assign({}, fig && fig.layout ? fig.layout : {});
            layout.margin = layout.margin || {l:50, r:16, t:40, b:48};
            var hasPie = data.some(function(t){ return t && (t.type === 'pie' || t['type'] === 'pie'); });
            if (hasPie) {
                layout.legend = Object.assign({orientation:'v', x:1.02, y:0.5}, layout.legend || {});
                layout.margin.r = Math.max(layout.margin.r || 16, 120);
            }
            // set pixel size from container so initial render is crisp
            try {
                var rect = container.getBoundingClientRect();
                if (rect.width > 20) layout.width = Math.round(rect.width);
                if (rect.height > 20) layout.height = Math.round(Math.max(rect.height, 240));
            } catch(e){}
            var config = (fig && fig.config) ? Object.assign({}, fig.config) : {};
            config.responsive = true;
            return {data: data, layout: layout, config: config};
        }

        // Render using the pattern you trust (double RAF + react/newPlot)
        function renderDataToPanel() {
            var tableEl = document.getElementById('table-container');
            if (tableEl && typeof main_map_table !== 'undefined') tableEl.innerHTML = main_map_table || '';

            var plots = (typeof main_map_plots !== 'undefined') ? main_map_plots : (window.main_map_plots || []);
            if (!plots || !plots.length) return;

            ensurePlotly(function(){
                requestAnimationFrame(function(){
                    requestAnimationFrame(function(){
                        ['plot_div','plot_div2','plot_div3', 'plot_div4'].forEach(function(id, idx){
                            try {
                                var container = document.getElementById(id);
                                var fig = plots[idx];
                                if (!container || !fig) return;
                                var norm = normalizeFig(fig, container);
                                var root = findPlotRoot(container);
                                var already = !!root;
                                if (already) {
                                    try { Plotly.react(container, norm.data, norm.layout, norm.config); }
                                    catch (e) { console.warn('Plotly.react failed, fallback newPlot', e); Plotly.newPlot(container, norm.data, norm.layout, norm.config); }
                                } else {
                                    Plotly.newPlot(container, norm.data, norm.layout, norm.config);
                                }
                            } catch (err) {
                                console.error('Plot render error for', id, err);
                            }
                        });
                        // after drawing, ensure visible plots are resized
                        requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); });
                    });
                });
            });
        }

        // Tab switcher
        function showPlotTab(index) {
            var i = Number(index) || 1;
            document.querySelectorAll('.plot-tab-btn').forEach(function(b, idx){
                var is = (idx === (i-1));
                b.classList.toggle('active', is);
                b.setAttribute('aria-selected', is ? 'true' : 'false');
            });
            document.querySelectorAll('.plot-content').forEach(function(c, idx){
                c.classList.toggle('active', idx === (i-1));
            });
            requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); });
        }

        // Show/hide/toggle behavior
        function showInfoPanel(){
            var p = document.getElementById('infoPanel');
            if (!p) return;
            p.style.display = 'flex';
            p.setAttribute('aria-hidden','false');
            // ensure panel-content visible (in case minimized previously)
            var content = document.getElementById('panel-content');
            if (content) { content.style.display = p.classList.contains('minimized') ? 'none' : 'flex'; content.setAttribute('aria-hidden', p.classList.contains('minimized') ? 'true' : 'false'); }
            renderDataToPanel();
            requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); });
        }
        function hideInfoPanel(){
            var p = document.getElementById('infoPanel');
            if (!p) return;
            p.style.display = 'none';
            p.setAttribute('aria-hidden','true');
        }
        function toggleMinimizePanel(){
            var p = document.getElementById('infoPanel');
            var content = document.getElementById('panel-content');
            var btn = document.getElementById('infoPanelToggle');
            if (!p || !content || !btn) return;
            var isMin = p.classList.toggle('minimized');
            if (isMin) {

                content.style.display = 'none';
                content.setAttribute('aria-hidden','true');
                btn.title = 'Maximize';
                btn.innerText = '';
            } else {
                content.style.display = 'flex';
                content.setAttribute('aria-hidden','false');
                btn.title = 'Minimize';
                btn.innerText = '';
                // re-render/resize now visible
                requestAnimationFrame(function(){ requestAnimationFrame(function(){ renderDataToPanel(); safeResizeActivePlot(); }); });
            }
        }

        // Wire up UI
        function initPanel() {
            var p = document.getElementById('infoPanel');
            if (!p) return false;

            // Close
            var closeBtn = document.getElementById('infoPanelClose');
            if (closeBtn) {
                closeBtn.onclick = hideInfoPanel;
                closeBtn.onkeyup = function(e){ if(e.key==='Enter' || e.key===' ') hideInfoPanel(); };
            }

            // Toggle minimize/maximize
            var tog = document.getElementById('infoPanelToggle');
            if (tog) {
                tog.onclick = toggleMinimizePanel;
                tog.onkeyup = function(e){ if(e.key==='Enter' || e.key===' ') toggleMinimizePanel(); };
            }

            // Tabs
            document.querySelectorAll('.plot-tab-btn').forEach(function(btn){
                btn.addEventListener('click', function(){ showPlotTab(this.getAttribute('data-tab')); });
                btn.addEventListener('keydown', function(e){ if(e.key==='Enter' || e.key===' ') { e.preventDefault(); showPlotTab(this.getAttribute('data-tab')); } });
            });

            // Window resize
            window.addEventListener('resize', function(){ requestAnimationFrame(function(){ requestAnimationFrame(safeResizeActivePlot); }); });

            var moTarget = document.getElementById('infoPanel');

        // Start when DOM ready
        function whenReady(fn) {
            if (document.readyState === 'loading') document.addEventListener('DOMContentLoaded', fn);

        whenReady(function(){

            try {

                if (t && (typeof main_map_table !== 'undefined' || typeof window.main_map_table !== 'undefined')) {
                    t.innerHTML = (window.main_map_table || main_map_table || '');

            } catch(e){ console.warn(e); }

            if (!initPanel()) {
                var tries = 0;
                var id = setInterval(function(){
                    if (initPanel()) { clearInterval(id); showInfoPanel(); }
                    tries++;
                    if (tries > 40) clearInterval(id);
                }, 120);
            } else {
                showInfoPanel();
            }
        });

        // Expose a few helpers
        window.showInfoPanel = showInfoPanel;
        window.hideInfoPanel = hideInfoPanel;
        window.toggleMinimizePanel = toggleMinimizePanel;
        window.renderZonesPlots = function(pls){ try { main_map_plots = pls; renderDataToPanel(); } catch(e){ console.warn(e); } };

    })();

    <script>
        /* openDistrictManagerPanel(dmName, charts = costCharts)
           - dmName: string to show in header
           - charts: array of serialized Plotly figures (each item has .data and .layout)
        */
        (function () {
          // debounce helper
          function debounce(fn, wait = 100) {
            let t;
            return function (...args) {
              clearTimeout(t);
              t = setTimeout(() => fn.apply(this, args), wait);
            };
          }

          // Render a Plotly figure inside a divId using the serialized chart object
          function renderPlotlyInto(div, figObj) {
            if (!window.Plotly) {
              console.error('Plotly is not loaded. Include Plotly before calling openDistrictManagerPanel.');
              return;
            }
            // deep copy to avoid mutating original
            const fig = JSON.parse(JSON.stringify(figObj || {}));
            const data = fig.data || [];
            const layout = fig.layout || {};

            // ensure responsive behavior
            layout.autosize = true;
            // don't force width/height if present; allow responsive to handle it
            delete layout.width;
            delete layout.height;

            // conservative default config for good interactivity
            const config = {
              responsive: true,
              displaylogo: false,
              modeBarButtonsToRemove: ['sendDataToCloud','lasso2d','select2d'],
              toImageButtonOptions: { format: 'png', scale: 2 }
            };

            // use Plotly.react for efficient rerendering
            return Plotly.react(div, data, layout, config);
          }

          // Attach the function to window so you can call it from outside
          window.openDistrictManagerPanel = function (dmName, charts = window.costCharts || []) {
            // create backdrop & panel only once if missing
            let backdrop = document.querySelector('.dm-modal-backdrop');
            if (!backdrop) {
              backdrop = document.createElement('div');
              backdrop.className = 'dm-modal-backdrop';
              document.body.appendChild(backdrop);
            } else {
              // clear content inside if exists (preserve backdrop)
              backdrop.innerHTML = '';
            }

            // Panel
            const panel = document.createElement('div');
            panel.className = 'dm-panel';
            backdrop.appendChild(panel);

            // Header / Title
        const header = document.createElement('div');
        header.className = 'dm-panel-header';

        // Title
        const title = document.createElement('h3');
        title.className = 'dm-panel-title';
        title.textContent = dmName || 'District Manager';
        header.appendChild(title);

        // Close button (inserted into header so it positions relative to header)
        const closeBtn = document.createElement('button');
        closeBtn.className = 'dm-close-btn';
        closeBtn.setAttribute('aria-label', 'Close panel');
        closeBtn.innerHTML = '&#x2715;'; // simple X
        closeBtn.addEventListener('click', closePanel);
        header.appendChild(closeBtn);

        // Finally append header to panel
        panel.appendChild(header);


            // Tabs bar
            const tabs = document.createElement('div');
            tabs.className = 'dm-tabs';
            const tabNames = ['Sales', 'Hosted Meetings Expenses','Sales vs Hosted Meetings Expenses'];
            const tabEls = [];
            tabNames.forEach((t, idx) => {
              const b = document.createElement('button');
              b.className = 'dm-tab' + (idx === 0 ? ' active' : '');
              b.textContent = t;
              b.dataset.tabIndex = idx;
              b.addEventListener('click', () => switchToTab(idx));
              tabs.appendChild(b);
              tabEls.push(b);
            });
            panel.appendChild(tabs);

            // Content area
            const content = document.createElement('div');
            content.className = 'dm-content';
            panel.appendChild(content);

            // === Add the resize handle ===
            const resizeHandle = document.createElement('div');
            resizeHandle.className = 'dm-resize-handle';
            panel.appendChild(resizeHandle);

            // Chart wrapper and chart div
            const chartWrap = document.createElement('div');
            chartWrap.className = 'dm-chart-wrap';
            const chartDiv = document.createElement('div');
            chartDiv.className = 'dm-chart';
            chartDiv.id = 'dm-plotly-chart'; // stable id
            chartWrap.appendChild(chartDiv);
            content.appendChild(chartWrap);

            // optionally add a footer or extra info slot later

            // Make backdrop visible (it already is) and prevent body scroll
            document.body.style.overflow = 'hidden';

            // track currently rendered chart index & resize handler
            let currentIndex = null;
            let resizeHandler = null;

            function switchToTab(index) {
              if (index === currentIndex) return;
              // update active state on tabs
              tabEls.forEach((el, i) => el.classList.toggle('active', i === index));
              currentIndex = index;

              // fetch serialized figure  ensure charts array exists and has relevant item
              const figObj = (Array.isArray(charts) && charts[index]) ? charts[index] : null;
              if (!figObj) {
                chartDiv.innerHTML = '<div style="padding:20px;color:#6b7280">Chart data not available.</div>';
                return;
              }

              // render with Plotly
              renderPlotlyInto(chartDiv, figObj).then(() => {
                // Plotly plotting done; make sure it fills container
                try { Plotly.Plots.resize(chartDiv); } catch (e) { /* ignore */ }
              }).catch(err => {
                console.error('Plotly render error', err);
              });
            }

            // initial render first tab
            switchToTab(0);

            // responsive resize handling (debounced)
            resizeHandler = debounce(() => {
              try {
                const el = document.getElementById('dm-plotly-chart');
                if (el && window.Plotly) Plotly.Plots.resize(el);
              } catch (e) { /* noop */ }
            }, 120);
            window.addEventListener('resize', resizeHandler);

            // Close function (cleans up)
            function closePanel() {
              try {
                // remove panel/backdrop
                if (backdrop && backdrop.parentNode) backdrop.parentNode.removeChild(backdrop);
                // cleanup body overflow
                document.body.style.overflow = '';
                // remove resize listener
                if (resizeHandler) window.removeEventListener('resize', resizeHandler);
              } catch (e) { console.error(e); }
            }

            // expose programmatic close in case needed
            panel.closePanel = closePanel;

            /*
            // also close on backdrop click (outside panel)
            backdrop.addEventListener('click', function (ev) {
              if (ev.target === backdrop) closePanel();
            });
            */

            // keyboard escape to close
            const keyHandler = (ev) => { if (ev.key === 'Escape') closePanel(); };
            window.addEventListener('keydown', keyHandler);

            // ensure we clean the keydown listener on close
            const originalClose = closePanel;
            closePanel = function () {
              window.removeEventListener('keydown', keyHandler);
              originalClose();
            };

          }; // end openDistrictManagerPanel

          // === Make panel resizable ===
        (function makePanelResizable() {
          let isResizing = false;
          let startX, startY, startWidth, startHeight;

          document.addEventListener('mousedown', function(e) {
            if (!e.target.classList.contains('dm-resize-handle')) return;
            isResizing = true;
            const panel = document.querySelector('.dm-panel');
            startX = e.clientX;
            startY = e.clientY;
            startWidth = parseInt(window.getComputedStyle(panel).width, 10);
            startHeight = parseInt(window.getComputedStyle(panel).height, 10);
            document.body.style.userSelect = 'none';
          });

          document.addEventListener('mousemove', function(e) {
            if (!isResizing) return;
            const panel = document.querySelector('.dm-panel');
            const newWidth = Math.max(startWidth + (e.clientX - startX), 800);
            const newHeight = Math.max(startHeight + (e.clientY - startY), 400);
            panel.style.width = newWidth + 'px';
            panel.style.height = newHeight + 'px';

            // Resize plot dynamically
            const chart = document.getElementById('dm-plotly-chart');
            if (chart && window.Plotly) {
              Plotly.Plots.resize(chart);
            }
          });

          document.addEventListener('mouseup', function() {
            if (isResizing) {
              isResizing = false;
              document.body.style.userSelect = '';
            }
          });
        })();

        })(); // IIFE
        
        document.getElementById("sales-expenses-btn").addEventListener("click", function () {
            openDistrictManagerPanel("Sales Vs Expenses");
        });

    </script>
